def derive(x, y):
    xnew = np.zeros(len(x) - 1)
    yp = np.zeros(len(x) - 1)
    ds=[]
    for i in range(len(y) - 1):
        xnew[i] = (x[i] + x[i+1]) / 2
        yp[i] = (y[i + 1] - y[i]) / (x[i + 1] - x[i])  ## calcul des valeurs de la dérivée
        d=yp[i]
        ds.append(d)
    print('ds=', ds)
    plt.plot(x[0:len(x) - 1], yp, label="f'(x)")
    plt.legend()
    plt.show()
    return ds
